import React from 'react';
import { Redirect, useHistory } from 'react-router-dom';

import classes from './NavBar.module.css';

const NavBar = () => {
  const history = useHistory();

  //Chuyển sang trang home
  const homeHandler = () => {};

  //Chuyển sang trang shop
  const shopHandler = () => {
    <Redirect to='/shop' />;
  };

  //Chuyển sang trang cart
  const cartHandler = () => {};

  //Chuyển sang trang login
  const loginHandler = () => {};

  return (
    <div className={classes.navBar}>
      <button className={classes.btn_left} onClick={homeHandler}>
        Home
      </button>
      <button className={classes.btn_left} onClick={shopHandler}>
        Shop
      </button>
      <header>BOUTIQUE</header>
      <button className={classes.btn_right} onClick={loginHandler}>
        <i className='fas fa-user-alt'></i>
        Login
      </button>
      <button className={classes.btn_right} onClick={cartHandler}>
        <i className='fas fa-dolly-flatbed'></i>
        Cart
      </button>
    </div>
  );
};

export default NavBar;
